import React, {useState} from 'react'
import Header from './Header'


type TProps = {
    setIsNavbarOpen: (isMenuMode: boolean) => void
    isNavbarOpen: boolean
}

const HeaderContainer: React.FC<TProps> = React.memo(({setIsNavbarOpen, isNavbarOpen}) => {


    return <Header isNavbarOpen={isNavbarOpen} setIsNavbarOpen={setIsNavbarOpen} />
})

export default HeaderContainer
